import React from 'react';
import InputItem from './inputitems';

const Step3 = ({ userObject, handleChange }) => {
    return (
        <div className='step'>
            <h2>Education</h2>
            <InputItem className='uni' onChange={handleChange} label='University' placeholder='Enter University Name' name='uni' value={userObject.uni || ''} />
            <InputItem className='degree' onChange={handleChange} label='Degree' placeholder='Enter Degree' name='degree' value={userObject.degree || ''} />
            <InputItem className='gradYear' onChange={handleChange} label='Graduation Year' placeholder='Enter your Graduation Year' name='gradYear' value={userObject.gradYear || ''} />
            <InputItem className='gpa' onChange={handleChange} label='GPA' placeholder='Enter GPA' name='gpa' value={userObject.gpa || ''} />
        </div>
    );
};

export default Step3;
